import React from 'react'
import styled from "styled-components";

const Input = ({type, palceholder}) => {
    return (
        <div>
            <input type="text" />
            <div />
        </div>
    );
};

const StyledInput = styled.input`
    width: 80%;
    max-width: 350px;
    min-width: 250px;
    height: 40px;
`

const Container  = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
`;

export default Input;
